INSERT INTO `cell` VALUES (127,'Hornbill Foundation Research Extention Centre','Centre for Ecology, Taxonomy, Conservation and Climate Change (CEtC) research and extension centre of Western Ghats Hornbill Foundation in the MES Asmabi College, Campus since 2011.','1',NULL,'cell@123','9048627870','CEtC, Western Ghats Hornbill Foundation, MES Asmabi College, P. Vemballur, Thrissur, 680671, Kerala, India, https://hornbillfoundation.org/mycentre/2,','Hornbill Foundation','2011-08-15','8',3,NULL,'1','3',NULL,'4','1','2011186469.png',NULL,184,'ICT'),(128,'IPR','asad',NULL,NULL,'cell@123','9846514038','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','aa','2022-07-05','8',8,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,98,'Club'),(129,'notification','MES Asmabi Collegee','NA',NULL,'cell@123','9497627870','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.',NULL,'2021-05-05',NULL,41,NULL,'1','1','1','1','1','569875057.png',NULL,98,'WebCell'),(130,'Media News Asmabi','mes asmabi news for web updations','NA',NULL,'cell@123',NULL,'mes asmabi news','mes asmabi news','2021-05-05',NULL,181,'Najma Nazeer','1','1','1','1','1','443469241.jpeg',NULL,98,'WebCell'),(131,'Examination Asmabi','MES Asmabi. College Examination','1',NULL,'cell@123','9497627870','MES Asmabi College','MES Asmabi College','1968-05-02',NULL,41,NULL,'1','1','1','1','1',NULL,NULL,98,'WebCell'),(133,'Grievance Redressal Cell','<p>Grievance Redressal Cell</p>\r\n\r\n<p>Grievance Redressal Cell functions at department level and college level. The Grievance Redressal Committee in each Department comprises of course teacher and one senior teacher as members and the Head of the Department as Chairman.</p>\r\n\r\n<p>The Committee addresses all grievances raised by students.</p>\r\n\r\n<p>The college level Grievance Redressal Committee comprises of Faculty advisor, two senior teachers and two staff council members (one shall be an elected member) and the Principal as Chairman.</p>\r\n\r\n<p><strong>TEACHER&rsquo;S IN-CHARGE OF GRIEVANCE REDRESSAL CELL&nbsp;</strong></p>\r\n\r\n<p>Dr. Haseena V.A</p>\r\n\r\n<p>Dr K Kesavan</p>\r\n\r\n<p>Dr. Sheena P A</p>\r\n\r\n<p>Veenalekshmi U R</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Student Representative</p>\r\n\r\n<p>Amrutha C (IInd M.A Economics)</p>','1',NULL,'cell@123','9496700495','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','MES Asmabi','2011-12-12','15',253,'Veenalekshmi U.R.','1','1','1','11','1','1704803456.png',NULL,190,'WebCell'),(134,'IEDC &ED Club Asmabi','<p><strong>Innovation and Entrepreneurship Development Centres (IEDC)</strong></p>\r\n\r\n<p>The Innovation and Entrepreneurship Development Centres (IEDC) are platforms set up in Engineering, Management, Arts &amp; Science Colleges, Medical Institutions,&nbsp;Polytechnics and Universities with an aim to provide students with an opportunity to experiment and innovate. Kerala Startup Mission has set up IEDCs in&nbsp;341&nbsp;institutions across the State which provide avenues for creative students to learn, collaborate and transform their innovative ideas into prototypes of viable products and services. IEDCs works as the first launch pad for a student&rsquo;s entrepreneurial journey and provide them with access to cutting edge technology, world-class infrastructure, high-quality mentorship, early risk capital and global exposure.</p>\r\n\r\n<p>IEDC MES Asmabi constitued in 2021 with an aim to findout the innovative ideas of students and mainstream socially&nbsp; significant ideas.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nodal officer: Chithra P</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Assi. Nodal officer : Dr. Dhanya PR</p>\r\n\r\n<p>&nbsp;Mail ID for communication :iedcmesac@gmail.com</p>','1',NULL,'cell@123','9847440933','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','KERALA STARTUP MISSION','2020-12-12',NULL,41,'Dr. Dhanya P. R','1','1','1','1','1','2123790258.png',NULL,191,'ICT'),(135,'IIC Asmabi','asa','a',NULL,'cell@123','9074857872','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','asd','2020-09-11','10',61,NULL,'1','1','1','1','1',NULL,NULL,98,'ICT'),(136,'Fine Arts Club Asmabi','as','a',NULL,'cell@123','9074857872','Fine Arte Club, MES Asmabi College, p Vemballur, 680671. Kodungallur. Kerala','Asmabi College','2020-09-11','10',140,'Chithra P','1','1','1','1','1','1709682514.jpeg',NULL,98,'Club'),(137,'Counselling Cell Asmabi','The Counseling cell is working under the Department of Psychology for the students and staff members of MES Asmabi College. The Cell started it functioning since 2015. The primary intention of the counseling cell is to ensure better Psychological services from a trained professional with in the campus. The cell provides Individual and group consultation as well as Psychological first aid at crucial instances. The Cell also conduct various mental Health well being Sessions and Workshops for the students and faculty members.','1',NULL,'cell@123','9946238540','Department of Psychology , MES Asmabi College , P Vembalur','Calicut University','2015-01-06','26',88,'Minsila Hilal','0','0','0','0','1',NULL,NULL,98,'Club'),(138,'Mental Health Club Asmabi','As a Stepping stone to Improve the Mental Health Literacy and reducing the stigma and unawareness associated with it, The Department of Psychology has introduced a Mental Health Club, for the students and faculty members of our college.','1',NULL,'cell@123','9745260514','Department of Psychology , MES Asmabi College, P. Vembalur','MES Asmabi College, P. Vembalur','2022-02-24','26',142,NULL,'60','60','0','120','1','361380989.jpg',NULL,98,'Club'),(139,'CMHEP Community Project Cell','Community Mental Health Empowerment Program (CMHEP)  initiated \r\nby Department of Psychology, MES Asmabi College, P.Vemballur  . As part of the Project,  there will be programs initiated by the Department for the community mental health empowerment by better practices and services. The faculties and Psychology Trainees of the department will be providing Mental Health services to the community on the need basis.','1',NULL,'cell@123','9946238540','Department of Psychology , MES Asmabi college. P. Vemballur','MES Asmabi College','2022-10-14',NULL,88,'Minsila Hilal','15','119','0','134','1','IMG_20221012_205431.jpg',NULL,98,'Club'),(140,'Folklore club','Under the auspices ok  kerala  folklore academy ,Kanoor, a Folklore club has been functioning in Malayalam Dept,since 2003','1',NULL,'cell@123','34384345345','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','03-11-2003','2003-11-03','12',22,'Liji.T','200','500','5','705','1','942845331.jpg',NULL,197,'Club'),(141,'NIRF','<p>The National Institutional Ranking Framework (NIRF) is a methodology adopted by the Ministry of Human Resource Development (MHRD), Government of India, to rank institutions of higher education in India. The Framework was approved by the MHRD and launched by Minister of Human Resource Development on 29 September 2015. There are separate rankings for different types of institutions depending on their areas of operation like universities and colleges, engineering institutions, management institutions, pharmacy institutions and architecture institutions. M E S Asmabi College regularly particpates in NIRF since 2017.</p>','1',NULL,'cell@123','9495247407','qbvc','NIRF CELL MEMBERS:\r\n\r\nNodal Officer: Dr. Kesavan K\r\n\r\nMembers:\r\n1 . Dr.Sefiya K M\r\n2 . Dr. Amitha P Mani\r\n3. Dr. Jisha K C\r\n4 . Dr. Ansar E B','2017-01-25','11',16,'Dr. Sefiya K.M.','NA','NA','NA','NA','1',NULL,'1676035212.pdf',98,'WebCell'),(142,'Awards & Achievemnts','Facilitate and document awards and achievements of the college, students and faculties','a',NULL,'cell@123','9497627870','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','2020-09-14',NULL,3,'Dr. Amitha P. Mani','1','1','1','1','1','0861b76ad6e3b156c2b9d61feb6af864_(1).jpg',NULL,98,'WebCell'),(143,'ASAP / CCCC Forum',NULL,'1',NULL,'cell@123','9847841441','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','ASAP Kerala','2020-01-01','15',23,NULL,'1','1','1','3','1','1680530569.jpeg',NULL,199,'Academic Devlopment'),(144,'IQAC','IQAC','1',NULL,'cell@123','9847250464','IQAC','IQAC','2020-01-01',NULL,43,'Dr. K.H. Amitha Bachan','1','1','1','3','1',NULL,NULL,98,'WebCell'),(145,'Bhoomithra Sena & Nature Club Asmabi','The Nature club was established in the college during 1994-95 and later the Bhoomithra Sena Club designated by the Department of Climate Change, Govt. of Kerala augmented with the Nature Club. The presnt  coordinator of the Club is Dr. Amitha Bachan K.H., Research Department of Botany, MES Asmabi College','1',NULL,'cell@123','9048627870','Bhoomithra sena & Nature Club, Department of Botany, MES Asmabi College, P. Vemballur. 680671- Kerala India.','Climate Change department, Govt. of Kerala.','2020-01-01','8',3,NULL,'1','1','1','3','1','2105058973.jpg',NULL,98,'Club'),(146,'OBC Cell','fgdrgedgbe','1',NULL,'cell@123','9895886131','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.',NULL,'2020-01-01','15',29,'Sabeena P A','1','1','1','3','1','1704620113.png','1704620113.pdf',202,'Club'),(147,'Tutorial System','bfsbdfbd','1',NULL,'cell@123','9495587784','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','eebveeb','2020-01-01','10',179,NULL,'1','1','1','3','1',NULL,NULL,98,'Academic Devlopment'),(150,'Career Guidance & Placement Cell','<p>Career Guidance &amp; Placement Cell , MES Asmabi College , P Vemballur</p>','1',NULL,'cell@123','+917736364688','MES Asmabi College, P. Vemballur','IQAC','2020-01-01',NULL,26,'Dr.Shahija V A','500','500','0','1000','1','1695145938.jpg','1695146341.pdf',820,'Academic Devlopment'),(151,'Incubation Cell',NULL,'1',NULL,'cell@123','9497627870','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','2020-01-01',NULL,187,'Dr. K.H. Amitha Bachan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,98,'ICT'),(152,'AISHE','ALL INDIA SURVEY ON HIGHER EDUCATION\r\n\r\nReport of 2021-2022 attached','1',NULL,'cell@123','8157062509','AISHE ID-  C-8215\r\n\r\nMES ASMABI COLLEGE, P. VEMBALLUR\r\n\r\nKODUNGALLUR, THRISSUR\r\n\r\nKERALA, INDIA\r\n\r\nPIN- 680671','UNIVERSITY OF CALICUT','2012-01-01','15',188,NULL,'1073','1480','0','2553','1','1676055994.jpg','1676055620.pdf',98,'Commities'),(153,'SC/ST Cell','rggerge','1',NULL,'cell@123','8822224228','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','2022-01-01','41',109,'Balasubrahmanian Uruniankuth','1','1','1','3','1',NULL,NULL,98,'Club'),(154,'National Service Scheme','asds','53 & 95',NULL,'cell@123','9746227728','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','University of Calicut','2000-01-01','13',151,'Dr. Princy Francis','100','100',NULL,'200','2','1989687695.jpeg','1680201701.pdf',209,'Club'),(155,'Swachh Bharath','asds','1',NULL,'cell@123','8111866934','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','2020-01-01','41',103,NULL,NULL,NULL,NULL,NULL,NULL,'652665215.jpg',NULL,98,'Club'),(160,'IPR Cell Asmabi','IPR Cell of MES Asmabi college is conducting activities related to intellectual property rights. IPR  cell signed a MOU with IPR cell of St. Peter\'s College, Kolenchery on 29-07-2022 and both the institutions together conducting a certificate course on IPR.  The IPR cell also providing guidance to the faculties for applying patents for their innovations.','1',NULL,'cell@123','9846514038','MES ASMAB COLLEGE, P. VEMBALLUR, KODUNGALLUR','MES ASMABI COLLEGE','2021-06-01','8',8,'Dr. Sayana K . A.','18','32',NULL,'50','1','1528865199.png','1680365988.pdf',805,'WebCell'),(162,'Research Promotion & Journal','to promote research and publication','1',NULL,'cell@123','9447467982','MES Asmabi College, P Vemballur.','MES Asmabi College, Research and Devlopment','2019-01-17',NULL,20,NULL,'32','23',NULL,'55','4','1680364935.jpg',NULL,98,'Commities'),(163,'Minority Cell Asmabi',NULL,'1',NULL,'cell@123',NULL,'Minority Cell, MES Asmabi College, P Vemballur- 680671. Thrissur. Kerala. India.',NULL,'2018-07-18','12',22,'Nisha M. D.','456','1200',NULL,'1656','1','936586332.jpg','1696503024.pdf',811,'Club'),(164,'Women Development Cell','<p>Women Development Cell (WDC) was constituted in MES Asmabi College in 2008 as per the guidance from the Centre for Women Studies, University of Calicut , aims to promote Self-Empowerment of girls Students . &ldquo;Each Woman for a Woman&rdquo; is the motto of the Cell .To attain this goal, WDC is organising&nbsp;many programmes like Debates ,Workshops, Talk Shows , Various Competition and Awareness programmes for girls, Field Trip to enhance the love of nature among girls . WDC also deals with the various issues related to girls. Apart from that, a suggestion Box is set up for girl students which enable them to report their problems at any time when they meet issues. Their Problems are solved in front of the Principal, College Grievance cell and WDC based on the status of the issues.The Cell offers counselling to the students whenever needed. Personal issues of any students which needs Privacy may kept so and that issue will be discussed and solved only among the senior teaching staff of the WDC&nbsp;</p>','1',NULL,'cell@123','09495871943','Department of Mathematics , MES asmabi College, P Vemabllur',NULL,'2023-01-04','24',273,'Dhini.K.V',NULL,'100',NULL,'100','1','615015956.jpg',NULL,812,'Club'),(165,'Biodiversity Club Asmabi',NULL,'1',NULL,'cell@123','9633264761','Biodiversity Club, MES Asmabi College, P Vemballur. 680671- Thrissur. Kerala., India','Kerala State Biodiversity Board','2023-01-10','30',160,'Ujjwala Navas','24','26',NULL,'50','1','1312531363.1',NULL,813,'Club'),(166,'NCC Asmabi College','asds','6th Company',NULL,'cell@123','9495464706','NCC Asmabi College, 6Th Company, P. Vemballur, Thrissur. Kerala. India.','NCC, Govt of india','1994-01-04','22',42,NULL,'34','16',NULL,'50','1',NULL,NULL,98,'Club'),(167,'Tourism Club Asmabi','<p>Welcome to the college tourism club! Our club is designed for students who love to travel, explore new places, and experience different cultures. As a member of our club, you&#39;ll have the opportunity to join like-minded individuals on exciting adventures and trips to destinations both near and far.</p>\r\n\r\n<p>Our club is focused on providing students with unique and memorable travel experiences. We organize trips that allow students to explore new places, learn about different cultures, and engage in recreational activities with their peers. We believe that travel is an essential component of education, and we strive to create opportunities for students to learn beyond the classroom.</p>\r\n\r\n<p>Our club is open to all students, regardless of their major or background. We believe that travel is a universal experience that can bring people together, and we welcome diversity in our membership. As a member of our club, you&#39;ll have the chance to meet and connect with students from different walks of life, creating a community of passionate travelers on campus.</p>\r\n\r\n<p>Some of the activities and events we organize include sightseeing tours, outdoor adventures, cultural experiences, and social events. We also encourage members to participate in volunteer work, such as community service projects or conservation efforts, while on their trips. Our club is a great way to make new friends, build leadership skills, and create lifelong memories.</p>\r\n\r\n<p>We invite you to join our club and start exploring the world with us. Don&#39;t miss out on this incredible opportunity to expand your horizons and create unforgettable experiences.</p>','1',NULL,'cell@123','7025336035','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','MES Asmabi College, P Vemabllur, Thrissur, Kerala, India.','2021-08-18','33',229,'Rasmin Mohd Ismail','12','56','0','68','1','1683280484.jpeg','1683280484.pdf',900,'Club'),(169,'PTA Asmabi','MES Asmabi College','1',NULL,'cell@123','9495667609','MES Asmabi College','MES Asmabi College','1980-02-12','41',44,NULL,'1','1',NULL,'2','1','2133825738.jpg',NULL,98,'Club'),(171,'Internal Compliance Cell Asmabi','<p><strong>Internal complaint committee </strong></p>\r\n\r\n<p>Internal complaint committee is a body envisioned to receive complaints on sexual harassment at the workplace from an aggrieved women, as well as inquire into and the recommendation to the employer on the action required.</p>\r\n\r\n<p>MES Asmabi College, has zero tolerance against disrespect and exploitation of women. The internal complaint committee has been established according with provisions of &ldquo;The Sexual Harassment of Women at Workplace (Prevention, Prohibition and Redressal) Act 2013&rdquo;.</p>\r\n\r\n<p><strong>Objective:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>To create a secure physical and social environment for women.</li>\r\n	<li>To develop guidelines against women harassment.</li>\r\n	<li>To organize women sensitization awareness program.</li>\r\n	<li>To provide a safe environment that is free from sexual harassment.</li>\r\n	<li>To promote social and psychological environment that will raise awareness about sexual harassment.</li>\r\n	<li>Recommend appropriate punitive action against the guilty.</li>\r\n	<li>Prevention of discrimination and sexual harassment against women.</li>\r\n</ul>\r\n\r\n<p><strong>Job roles of Committee:</strong></p>\r\n\r\n<ul>\r\n	<li>To create and ensure a safe work environment that is free of sexual harassment especially for girls and women.</li>\r\n	<li>To take note of complaints of sexual harassment of women employed, to conduct enquires and to provide assistance.</li>\r\n	<li>To recommend to the concerned authorities, follow-up action and to monitor the same.</li>\r\n	<li>To maintain an atmosphere of equality and gender justice.</li>\r\n	<li>To prepare annual reports.</li>\r\n</ul>\r\n\r\n<p>Presiding officer</p>\r\n\r\n<p>Dr Haseena V.A , Assistant professor and Head, Post Graduate Department of Economics</p>\r\n\r\n<p>Members</p>\r\n\r\n<p>Dr Kesavan , Associate Professor, Department of Aqua culture</p>\r\n\r\n<p>Ms Veenalekshmi U.R, &nbsp;Assistant Professor, Post Graduate Department of English</p>\r\n\r\n<p>Committe member&rsquo;s non-teaching staff</p>\r\n\r\n<p>Sadarudheen K. A (Junior superintendent)</p>\r\n\r\n<p>Saliha PI, (Libraraian ,UGC)</p>\r\n\r\n<p>Committee members-students</p>\r\n\r\n<p>Laya P.S (College Union Chairperson)</p>\r\n\r\n<p>Amrutha T.M (M.A Economics)</p>','1',NULL,'cell@123','9496700495','Internal Compliance Committee\r\nMES Asmabi College','MES Asmabi College','2018-03-15','15',253,'Dr. Kesavan K.','0','0','0','0','1',NULL,NULL,1316,'WebCell'),(601,'Green campus initiatives',NULL,'1',NULL,'cell@123','9526833254','MES Asmabi College, P Vemballur, 680671- P. Vemballur, Kerala, India.','MES Asmabi College','2018-06-05','8',9,'Dr. Girija T. P',NULL,NULL,NULL,NULL,'1',NULL,NULL,98,'Club'),(602,'Sports Academy',NULL,NULL,'sportsacademy@mes.org','cell@123','9495464706','MES Asmabi College',NULL,'2021-06-01',NULL,42,NULL,NULL,NULL,NULL,NULL,NULL,'','',NULL,'Club'),(603,'Alumni','ad',NULL,'asmabialumni1@gmail.com','cell@123',NULL,'ad','da','0094-06-01',NULL,56,'Mona V. M.',NULL,NULL,NULL,NULL,NULL,'1896360378.png','',NULL,'Club'),(604,'Planning and Infrastructure',NULL,NULL,NULL,'cell@123','9497627870',NULL,NULL,'2011-06-01',NULL,3,'Prof. (Dr.) A. Biju',NULL,NULL,NULL,NULL,NULL,NULL,NULL,98,'Infrastructure'),(605,'Research Council','<p>The council assists and provides guidance to research scholars in obtaining research project.</p>',NULL,NULL,'cell@123','9497627870','MES Asmabi College P Vemballur','MES Asmabi College P Vemballur','2011-01-09',NULL,